import React, { Component } from "react";
import InputForm from "./components/inputForm";
import AnomalyChart from "./components/anomalyChart";
import "../style.css";

class Controller extends Component {
  render() {
    return (
      <React.Fragment>
        <Row>
          <InputForm />
        </Row>

        <Row>
          <AnomalyChart />
        </Row>
      </React.Fragment>
    );
  }
}

export default Controller;
